import React from "react";
import OnBording from "./OnBording";
import "./OnBording1.css";

function OnBording2() {
    const Props=
        {Heading1:"DELIVER AT ",
        Heading2:"YOUR",
        Headin3:"DOORSTEP",
        Para:"Fresh and delicious local food delivered from the restaurants to your doorstep",
        Link:""
    }
    
  return (
    <>
      <OnBording Heading1={Props.Heading1} Heading2={Props.Heading2} Headin3={Props.Headin3} Para={Props.Para}  />
    </>
  );
}

export default OnBording2;
